package JavaTrainingPractice;

public class While_DoWhile_ForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		// While Loop
		int i=0;
		while (i<=4){
			System.out.println("Tulika");
			i++;
		} 
		//While Loop Complete
		
		// Do While Loop
		 i=0;
		do {
			System.out.println("Kairav");
			i++;	
		} while (i<=4);
		//Do while Complete;
		
		//for Loop
		for (i=0;i<=4;i++) {
			System.out.println("Kunal");
			
		}
		//for Loop Complete
	}

}
